const columns = [
  {
    title: 'STT',
    dataIndex: 'stt',
  },
  {
    title: 'Date',
    dataIndex: 'date',
    sorter: (a, b) => a.date - b.date,
  },
  { 
    title: 'Customer',
    dataIndex: 'customer',
  },
  {
    title: 'Name Product',
    dataIndex: 'nameProduct',
  },
  {
    title: 'Quantity',
    dataIndex: 'quantity',
  },
  {
    title: 'Phone Customer',
    dataIndex: 'phoneCustomer',
  },
  {
    title: 'Adress',
    dataIndex: 'address',
  },
  {
    title: 'Price',
    dataIndex: 'price',
  },
  {
    title: 'Total',
    dataIndex: 'total',
  },
];

export default columns;
